const questionHasKeywords=(e,t)=>{const n=e.indexOf(t[0]);if(-1==n)return!1;let r=n+1,s=1;for(;s<t.length;){if(r>e.length-1)return!1;if(t[s]!=e[r])return!1;r++,s++}return!0},FindBucket=e=>{const t=e.replace(/\?/g,"").trim().toLowerCase().split(" ").filter(e=>e);for(let e=0;e<AnswerBuckets.payload.length;e++){const n=AnswerBuckets.payload[e];for(let e=0;e<n.keywords.length;e++){const r=n.keywords[e],s=r.split(" ").map(e=>e.toLowerCase());if(questionHasKeywords(t,s)){const e=t.indexOf(r);if(!n.sequential.length)return n;if(e<t.length-1){const r=t[e+1];for(let e=0;e<n.sequential.length;e++)if(n.sequential[e].toLowerCase()==r)return n}}}}return AnswerBuckets.payload[AnswerBuckets.payload.length-1]};